	Num_Reg_CR_CA_RT varchar,
	Infos float[]
) 

select * from alvara

--drop table alvara



--- inserção dados



-- funcao l2
create or replace function l2(elem1 float[], elem2 float[]) returns float as $$
declare
 size integer;
 somat float;
begin
 select cardinality(Infos) into size from alvara limit 1;
 somat := 0;
 for i in 1..size loop
    somat := somat + (ABS(elem1[i] - elem2[i])*ABS(elem1[i] - elem2[i]));
 end loop;
 return sqrt(somat);
end $$
language plpgsql;


-- funcao KNN
 create or replace function KNN(qc float[], k integer) 
 returns table (id integer, distance float) as $$
 begin
  return query 
      select alvara.id, l2(infos,qc) as distance
      from alvara
      order by l2(infos,qc) LIMIT k;
 
 end $$
 language plpgsql;

-- consulta KNN 
 select KNN.id, Material, Finalidade, Num_Reg_CR_CA_AU, Num_Reg_CR_CA_RT, distance from KNN(array[349420.2,7905.9,974.4,561.8,28.43], 5)
 join alvara on KNN.id=alvara.id
   
   
-- funcao range query
 create or replace function RangeQuery(qc float[], radius float) 
 returns table (id integer, distance float) as $$
 begin
  return query 
      select alvara.id, l2(Infos,qc) as distance
      from alvara
      where l2(Infos,qc) <= radius;
 
 end $$
 language plpgsql; 
 
 -- consulta range query
  select RangeQuery.id, Material, Finalidade, Num_Reg_CR_CA_AU, Num_Reg_CR_CA_RT, distance from RangeQuery(array[349420.2,7905.9,974.4,561.8,28.43], 1800)
 join alvara on RangeQuery.id=alvara.id
 order by distance 
                                            
 -- demais consultas
 --- q1.1

select bairro, avg(area_liberada) as md_area_liber from imovel im, alvara al
where im.numero_alvara =al.numero_alvara 
group by bairro
order by avg(area_liberada) desc

---q1.2

select bairro, avg(area_liberada) as md_area_liber from imovel im, alvara al
where im.numero_alvara =al.numero_alvara and
	extract( year from data_inicio_obra) between 2020 and 2021
group by bairro
order by avg(area_liberada) desc

---q2.1

select nome, bairro, avg(area_liberada) as md_area_liber 
from imovel im, alvara al, autor_projeto ap
where im.numero_alvara =al.numero_alvara and
		ap.numero_crea_cau_au =al.numero_crea_cau_au 
group by nome, bairro
order by avg(area_liberada) desc

---q2.2

select nome, bairro, avg(area_liberada) as md_area_liber 
